ئىقتىدار چۈشەندۈرۈلىشى：
1.تۆشۈكى ئازراق توسۇلۇپ قالغاندا، بۇ ئىقتىدارنى بىر ئىككى قېتىم ئىشلەتسىڭىز بولىدۇ;
2.توسۇلۇش ئېغىر بولغاندا، بۇ ئىقتىدارنى %1$d-%2$d قېتىم ئىشلىتىڭ،ھەمدە ئۈسكۈنىنى تۇتۇپ تۇرۇپ پەسكە سىلكىش ھەرىكىتىنى تەڭ ئېلىپ بېرىڭ

%1$s بىلەن ئالاقە قىلالمىدى،
 سەۋەبلىرى تۆۋەندىكىدەك بولىشى مۇمكىن:
 1. بۇ ئۈسكۈنىنىڭ كۆكچىشى تاقاق ياكى ئالاقە دائىرىسىدە بولمىغاندا;
 2. ئۈسكۈنە جۈپلىنىش ھالىتىدە تۇرغاندا;
 3.بۇ ئۈسكۈنە باشقا ئۈسكۈنە بىلەن ئۇلاندى،ئۈزىۋېتىپ ئاندىن ئۇلاڭ.
